import * as React from 'react'
import utils from '../utils';
import classNames from 'classnames'
const prefixCls = 'dtc-chrome';

interface ChromeDownloadProps {
    downloadChrome?: (chromeOfOsType?: 'macChrome' | 'windowsChrome' | 'others') => void;
    className?: string;
    style?: React.CSSProperties;
}
export default class ChromeDownload extends React.Component<ChromeDownloadProps, any> {
    constructor(props: ChromeDownloadProps) {
        super(props);
    }
    renderDivide (name: any) {
        let divideLine = Array(25).fill('-');
        return <div>
            <span style={{ color: '#BFBFBF' }}>{divideLine.join(' ')}</span>
            <span className={`${prefixCls}-divider-text`}>{name}</span>
            <span style={{ color: '#BFBFBF' }}>{divideLine.join(' ')}</span>
        </div>
    }
    detectOS () {
        if (utils.isMacOs()) return 'macChrome';
        if (utils.isWindows()) return 'windowsChrome';
        return 'others';
    }
    render () {
        return (
            <div className={classNames(`${prefixCls}-chrome-download`, this.props.className || '')} style={Object.assign({ height: '100%' }, this.props.style)}>
                <img src="data:image/png;base64," className={`${prefixCls}-pic-update`} />
                <div style={{ fontSize: '14px', color: '#333333' }}>Chrome66(Chrome)</div>
                <div className={`${prefixCls}-divide`}>
                    {this.renderDivide('')}
                </div>
                <div className={`${prefixCls}-download`}>
                    <a href="#" onClick={() => { this.props.downloadChrome(this.detectOS()) }}>
                        <img src='data:image/png;base64,' />
                        <div className={`${prefixCls}-chrome-version`}>Chrome72.0.3626.109</div>
                    </a>
                </div>
            </div>
        )
    }
}
